import Notes from './Notes';

const Home = () => {
    const username = localStorage.getItem("username");
    return (
        <div className="container my-2 ">
            <h2>Welcome, {username ? username : "User"}!</h2>
            <p>You are successfully logged in.</p>
            <hr />
            <Notes />
        </div>
    );
};

export default Home;
